INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 17814, 0, "うん、そうだよ。\n【王宮騎士団（NIGHTMARE）】\nと少年から、またひとつ成長した\nトモちゃんにプレゼントだ。", 10, 1, 0, 104711, 17814070, 11);
