INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 18814, 0, "ケーキとは別に、プレゼントも\nいくつか用意してあるのよ。\n私たちじゃどんなのがいいか\nよく分からなかったから……", 10, 1, 0, 105111, 18814081, 11);
