INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 19814, 0, "誕生日にそんなことされて喜ぶのは、\nクウカさんだけだと思います……", 10, 1, 0, 105511, 19814086, 11);
