INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 19814, 0, "ワタシの誕生日ケーキ！？\nそれは大変、ゴブレイしマシタ♪\n本来であればセップクものですが、\n腹よりケーキを切りまショウ♪", 10, 1, 0, 103011, 19814091, 11);
