INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 26214, 0, "そうだべ！\n誕生日おめでとう、シオシオ！\nこのケーキはシオシオの好きな\n牧場特製の食材も使って作ったべや！", 10, 1, 0, 103311, 26214068, 11);
