INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 26224, 0, "その通り、今日はカスミの誕生日さ～♪\nさっすが名探偵だね～！\nそれじゃあ早速、みんなで歌って踊って\nお祝いするよ～♪", 10, 1, 0, 101711, 26224068, 11);
