INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 26224, 0, "おめでとう、カスミ！\nていうか、姫さんほんとに踊るのか？\nだったら、カスミも一緒に踊ろうぜ！\nみんなでやった方が楽しいからな♪", 10, 1, 0, 104311, 26224078, 11);
