INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 27814, 0, "ちがう！\nこれは其方を祝うために用意したのだ！\nと、とにかく……\n誕生日おめでとう、クウカ。", 10, 1, 0, 105311, 27814073, 11);
