INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 31114, 0, "本日は、私の誕生日を祝っていただいて\nありがとうございます……\n豪華なケーキまで用意していただいて、\n何かお返しを考えないといけませんね。", 10, 1, 0, 103111, 31114071, 11);
