INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 0.5, 34314, 0, "ちょっと、欲張り過ぎでしょう！？\n一年に何回もこんなことしたら、\nランドソルからプリンが\n消えちゃうわよ！", 10, 1, 0, 102211, 34314086, 11);
